import React from "react";
import styled from "styled-components";
import palette from "../../lib/styles/palette";
import BgSection from "../common/BgSection";
import Button from "../common/Button";

const Head = () => {
  return (
    <BgSection bgName="main-bg2">
      <div>
        <Title>About</Title>
      </div>
      <div>
        <Button to="https://www.notion.so/yoonvelop/Hyebin-Yoon-c06bf6b603034b38872610b1e4b4c5c0">
          Resume
        </Button>
        <Button to="https://github.com/yoonvelop">GitHub</Button>
        <Button to="https://velog.io/@yoonvelop">Velog</Button>
      </div>
    </BgSection>
  );
};
const Title = styled.h1`
  color: ${palette.white};
  font-size: 2.5rem;
  font-weight: 600;
  margin: 0rem 0;

  & > span {
    font-weight: 500;
    font-size: 2.2rem;
  }
`;
export default Head;
